import React from "react";
import { Link, Route, Switch } from "react-router-dom";
const CartoonDetail = () => {
  return (
    <Switch>
      <Route exact path="/CartoonDetail" component={CartoonDetail}>
        <li></li>
      </Route>
    </Switch>
  );
};

export default CartoonDetail;
